import React from 'react';
import Storm from '../Storm.png'
import './Team.css'

const Members = [
    {
        name: '',
        avatar: 'https://cdn.discordapp.com/avatars/734560292024877056/6e6a68e216a05ea4d15f72226f6981b5.png?size=256',
    },
    {
        name: '',
        avatar: 'https://cdn.discordapp.com/avatars/734560292024877056/6e6a68e216a05ea4d15f72226f6981b5.png?size=256',
    },
]

function Team() {
    return (
        <div className='Team'>
            <img src={Storm} className='Storm' alt='Storm'></img>
            <h2>STORM#2856</h2>
        </div>
    );
}

export default Team;
